    value: In response to your letter dated 11/13
  - value: ' attached'
  - value: ' please find our amended October Quarterly Report.  Donors who gave contributions
      after the Primary have been noted as giving for Primary Debt Retirement per
      Commission guidelines.  Donors whose contributions had been incorrectly identified
      as general contributions have been corrected to show them as Primary Debt Retirement
      contributions.  The Cycle dates have been corrected and so the cycle to date
      column has been corrected to show the correct amounts.  Finally'
  - value: ' per our conversation with Adam Ragan'
  - value: ' we note that the 48 hour notices were filed on time for each contribution.  The
      contribution from Todd Booze was filed as a memo entry as the original check
      was from Ideal Homes of Norman LP.  That contribution was filed on 8/16'
  - value: ' however'
  - value: ' the memo entry did not print on the 48-hour notice as FECFile 4 did not
