      contact us if you have any questions or concerns.  Thank you.'
  expected_count: 4
  input: TEXT,F3A,,"In response to your letter dated 11/13, attached, please find
    our amended October Quarterly Report.  Donors who gave contributions after the
    Primary have been noted as giving for Primary Debt Retirement per Commission guidelines.  Donors
    whose contributions had been incorrectly identified as general contributions have
    been corrected to show them as Primary Debt Retirement contributions.  The Cycle
    dates have been corrected and so the cycle to date column has been corrected to
    show the correct amounts.  Finally, per our conversation with Adam Ragan, we note
    that the 48 hour notices were filed on time for each contribution.  The contribution
    from Todd Booze was filed as a memo entry as the original check was from Ideal
    Homes of Norman LP.  That contribution was filed on 8/16, however, the memo entry
    did not print on the 48-hour notice as FECFile 4 did not accept the memo amount
    as needing to be filed.  Both the Ideals Homes name and Mr. Booze were reported
    on the original October Quarterly per Commission guidelines.  Please contact us
    if you have any questions or concerns.  Thank you."
